import sys

k = int(sys.stdin.readline().strip())

if k % 2 == 0:
    print(-1)
else:
    for i in range(1, k + 1):
        for j in range(1, k + 1):
            if i % 2 == 1 and j % 2 == 1:
                sys.stdout.write("b")
            elif i % 2 == 0 and j % 2 == 0:
                sys.stdout.write("w")
